function Navigators({number, name}){
    return(
        <div>
            <span style = {{color: "white"}}>{number}</span>
            <div style = {{height: "2px",
                            width: 20,
                            backgroundColor: "white",
                            display: "inline-block",
                            marginLeft: 15}}></div>
            <span style = {{color: "white"}}> {name}</span>
        </div>
    );
}


export default Navigators;
